import React, { useRef } from 'react';
import { useReactToPrint } from 'react-to-print';

const CertificadoCompleto = ({ receta, paciente }) => {
  const printRef = useRef();

  const fecha = new Date(receta.fecha).toLocaleDateString();

  const handlePrint = useReactToPrint({
    content: () => printRef.current,
    documentTitle: `receta_${paciente?.nombre || 'paciente'}`.replace(/\s/g, '_'),
  });

  return (
    <div className="p-4 bg-white rounded shadow">
      <div className="flex justify-end mb-4">
        <button
          onClick={handlePrint}
          className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
        >
          Imprimir Receta
        </button>
      </div>

      <div ref={printRef} className="p-6 max-w-[800px] mx-auto border bg-white text-black font-sans relative">
        {/* Marca de agua como fondo */}
        <div className="absolute inset-0 z-0 flex items-center justify-center pointer-events-none">
          <p className="text-6xl font-bold opacity-10 whitespace-nowrap">ORTODONCIA RHELMÜ</p>
        </div>

        <div className="relative z-10 text-center mb-6">
          <img src="/logo-rhelmu.png" alt="Logo" className="h-16 mx-auto" />
          <h2 className="text-xl font-semibold">Dr. Mauricio Hurtado Cáceres</h2>
          <p className="text-blue-600 font-semibold">Ortodoncia y Ortopedia</p>
          <p className="text-blue-500">Dentomaxilofacial</p>
          <p className="text-sm mt-1">Rut: 12.917.335-1</p>
        </div>

        <h3 className="text-center text-lg font-bold underline mb-4 relative z-10">
          CERTIFICADO Y RECETA MÉDICA
        </h3>

        <div className="mb-4 text-sm relative z-10">
          <p><strong>Nombre:</strong> {paciente?.nombre}</p>
          <p><strong>RUT:</strong> {paciente?.rut}</p>
          <p><strong>Fecha:</strong> {fecha}</p>
          <p><strong>Vigencia:</strong> {receta.vigencia} días</p>
        </div>

        <div className="mb-4 relative z-10">
          <h4 className="font-semibold mb-1">Medicamentos Recetados:</h4>
          <ul className="list-disc ml-6 text-sm">
            {receta.medicamentos?.length > 0 ? (
              receta.medicamentos.map((med, idx) => (
                <li key={idx}>
                  <strong>{med.nombre}</strong> - {med.dosis}, {med.frecuencia} por {med.duracion}
                </li>
              ))
            ) : (
              <li className="text-gray-500">No hay medicamentos registrados.</li>
            )}
          </ul>
        </div>

        {receta.indicaciones && (
          <div className="mb-4 text-sm relative z-10">
            <h4 className="font-semibold">Indicaciones adicionales:</h4>
            <p>{receta.indicaciones}</p>
          </div>
        )}

        <div className="text-center mt-12 relative z-10">
          <p className="border-t border-black inline-block px-4 pt-2 font-semibold">
            Dr. Mauricio Hurtado Cáceres
          </p>
          <p className="text-sm">12.917.335-1</p>
        </div>

        <div className="text-sm text-center mt-6 relative z-10">
          Dirección: Lord Cochrane 635, Torre B, piso 10, Oficina 1002, Concepción.<br />
          Teléfono: +56 944435569
        </div>
      </div>
    </div>
  );
};

export default CertificadoCompleto;
